(1, 'Terras ja Laanet: Soome lennukiost on märgiline', 'Soome reedel avalikustatav otsus valida oma õhujõududele just Ameerika Ühendriikides valmistatud hävitajad on märgiline, kuna näitab, et Eesti põhjanaaber soovib ka NATO liige olemata hoida tihedat sidet USA-ga, leiavad kaitseminister Kalle Laanet ja endine kaitseväe juhataja Riho Terras.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
