INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(3, 'Karis ei lähe samuti poliitilistel põhjustel Pekingi olümpiamängudele', 'President Alar Karis ei lähe poliitilistel põhjustel veebruaris Hiinas Pekingis algavatele taliolümpiamängudele.\r\n\r\nOtepääl kahevõistluse MK-etappi vaatamas käinud Kairis ütles intervjuus Kanal2-s, et ta otsustas koos teiste lähiriikide riigipeadega Pekingi olümpiamängudele mitte minna, vahendas Postimees.', , 2, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(4, 'Päev liikluses: vigastada sai kuus inimest, kellest kaks olid lapsed', 'Kella 9.42 ajal sai Tallinnas Männiku tee 115 juures esialgsetel andmetel reguleerimata ülekäigurajal sõiduteed ületanud 21-aastane mees löögi sõiduautolt Škoda Octavia, mida juhtis 65-aastane naine. Jalakäija toimetati Põhja-Eesti regionaalhaiglasse. Täpsemad asjaolud on selgitamisel.', , 3, 1);

